  input: TEXT,F3A,,"The reason for this filning date centers on a series of unfortunate
    computer errors associated with the FEC File4 program.  The original file, developed
    for the mid-year 2001 report, was maintained on a floppy disk.  The December 31
    report was developed on a separate floppy disk during the final week in January
    with the idea of importing information from the previous filing and uploading
    the report before the deadline. Once the file was complete, a final check was
    run on all information (spellings, amounts, etc.) when a glitch developed in the
    file.  We contacted the FEC technicians again, who told us that our file was corrupted
    and information was missing which caused the program to malfunction.  Because
    of the way the program is developed, we had to find the missing information so
    that our aggregate totals would be correct.  When an attempt was made to file,
    we discovered that we did not have the correct filing code.  We requested a new
    one, and are now submitting our report.  We now maintain the file on a computer
    hard drive and store our filing code in a secure place.  The Davis campaign has
    received instructions from the FEC caseworkers on what to do if this or any problem
    occurs that might delay our submitting a report by the deadline.  We apologize
    for any inconvenience this may have caused."
